uint32_t test_stop_index = 0;
void test_audio_update(int32_t *samples, uint16_t num_samples) {
  if (!test_is_playing && test_do_play < 0) {
    return;
  }
  if (test_do_play >= 0) {
    test_is_playing = true;
    if (test_do_play % 7 == 0) {
      test_start_index = TEST_0_START;
      test_stop_index = TEST_0_STOP;
    } else if (test_do_play % 7 == 1) {
      test_start_index = TEST_1_START;
      test_stop_index = TEST_1_STOP;
    } else if (test_do_play % 7 == 2) {
      test_start_index = TEST_2_START;
      test_stop_index = TEST_2_STOP;
    } else if (test_do_play % 7 == 3) {
      test_start_index = TEST_3_START;
      test_stop_index = TEST_3_STOP;
    } else if (test_do_play % 7 == 4) {
      test_start_index = TEST_4_START;
      test_stop_index = TEST_4_STOP;
    } else if (test_do_play % 7 == 5) {
      test_start_index = TEST_5_START;
      test_stop_index = TEST_5_STOP;
    } else if (test_do_play % 7 == 6) {
      test_start_index = TEST_6_START;
      test_stop_index = TEST_6_STOP;
    } else {
      test_start_index = TEST_0_START;
      test_stop_index = TEST_0_STOP;
    }
    test_index = test_start_index;
    test_do_play = -1;
  }
  for (uint16_t i = 0; i < num_samples; i++) {
    int32_t audio = test_audio[test_index];
    // convert to 16-bit from 32-bit
    audio = audio << 16;
    samples[i * 2 + 0] += audio;
    samples[i * 2 + 1] += audio;
    test_index++;
    if (test_index >= test_stop_index) {
      test_is_playing = false;
      break;
    }
  }
}
